import React from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../../AuthProvider";
import { NavLink } from "react-router-dom";

const AdminNavbar = () => {

  const auth = useAuth();
  const navigate = useNavigate();
  const [error, setError] = React.useState(null);

  const submit = async () => {
    try {
      const res = await auth.logout();
      console.log("Logged out", res);
      navigate("/");
    } catch (err) {
      setError(err.response?.data?.message || "Login failed");
    }
  };
  return (
    <>
      <nav
        className="navbar navbar-expand-lg bg-light"
        style={{ position: "fixed", width: "100vw", zIndex: 10 }}
        data-bs-theme="light"
      >
        <div className="container-fluid" style={{ paddingLeft: "90px" }}>
          <NavLink className="navbar-brand" to="/" style={{ textDecoration: "none", color: "black" }}>
            Azbobinette
          </NavLink>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarColor03"
            aria-controls="navbarColor03"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarColor03">
            <ul className="navbar-nav me-auto">
              <li className="nav-item">
                <a className="nav-link active" href="#">
                  <NavLink
                    to="/"
                    style={({ isActive }) => ({
                      color: isActive ? "black" : "grey",
                      textDecoration: "none",
                    })}
                  >
                    Accueil
                  </NavLink>
                  <span className="visually-hidden">(current)</span>
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">
                  <li className="nav-item">
                                  <NavLink
                                    className={"nav-link"}
                                    to="/"
                                    style={({ isActive }) => ({
                                      color: isActive ? jungleActive.color : "grey",
                                      textDecoration: "none",
                                      fontWeight: isActive ? jungleActive.fontWeight : "normal",
                                    })}
                                  >
                                    Accueil
                                  </NavLink>
                                </li>
                </a>

              </li>
              
              <li className="nav-item">
                <a className="nav-link" href="#">
                  <NavLink
                    to="/about"
                    style={({ isActive }) => ({
                      color: isActive ? "black" : "grey",
                      textDecoration: "none",
                    })}
                  >
                    A propos
                  </NavLink>
                </a>
              </li>
             
            </ul>
            <form className="d-flex">
              <input
                className="form-control me-sm-2"
                type="search"
                placeholder="Search"
              />
              <button className="btn btn-secondary my-2 my-sm-0" type="submit">
                Search
              </button>
            </form>
            <a className="btn btn-outline-secondary" href="#" onClick={submit} style={{marginLeft: "20px"}}>
                    Logout
                  </a>
          </div>
        </div>
      </nav>
    </>
  );
};

export default AdminNavbar;
